import React from "react";
import CartItem from "./cartitem";


export default function CartItemContainer({myCart, setMyCart}){
    return(
        myCart.length>0 ? 
        myCart.map(item=>{
            return <CartItem key={item.id} name={item.name} amount={item.amount} price={item.price}
                    myCart={myCart} setMyCart={setMyCart} setSelectedMenu={setSelectedMenu}/>
        }) : null
    )
}
